import React from "react";
const timeTable = (props) => {
  return (
    <table>
      <tr>A day</tr>
      <th>yes a day</th>
      <tr>Monday</tr>
      {props.day.map((e) => (
        <td>{e.sub}</td>
      ))}
    </table>
  );
};

export default timeTable;
